Daisy's interview for the Dominatrix position is off to a bumpy start. Unsure of whether or not she's right for the job, her potential employer runs her through a series of commands. The problem with Daisy is that she seems hell bent on being in control all the time, and that's readily apparent by her actions. If she wants to get this position however, she'll need to learn that in order to be the best at this job she needs to relinquish control before she can take control of others. This interview will be like no other experience for her as she's run through the paces and taught some lessons in humility... 


